import ScreenHeading from "../../utilities/ScreenHeading/ScreenHeading";
import "./Portfolio.css";

import "swiper/css";

import Animations from "../../utilities/Animations";
import ScrollService from "../../utilities/ScrollService";


export default function Portfolio(props)  {
  let fadeInScreenHandler = (screen) => {
    if (screen.fadeInScreen !== props.id) 
    return;
    Animations.animations.fadeInScreen(props.id);
  };
  const fadeInSubscription = ScrollService.currentScreenFadeIn.subscribe(fadeInScreenHandler);
  return (
    
    <div className="portfolio" id="portfolio">
    {/* heading */}
    <div className="main-container fade-in" id={props.id || ""}>
        <ScreenHeading
        subHeading = {"Recent Projects"}
        title={'PortfoliosðŸ“·'}
     />
</div>


<div class="row">
<div class="col-lg-3"><img loading="lazy" src="https://hamna.dev/static/media/ui1.5f118c108da7a4f55589.png" class="gallery-image img-fluid img-thumbnail"></img>
</div>
<div class="col-lg-3"><img loading="lazy" src="https://hamna.dev/static/media/ui2.84b555b38a6a624d43e6.png" class="gallery-image img-fluid img-thumbnail"></img>
</div>
<div class="col-lg-3"><img loading="lazy" src="https://hamna.dev/static/media/ui3.46adb3b257300710c606.png" class="gallery-image img-fluid img-thumbnail"></img>
</div>
<div class="col-lg-3"><img loading="lazy" src="https://hamna.dev/static/media/ui4.7a8087d4c96162f4c318.png" class="gallery-image img-fluid img-thumbnail"></img>
</div>
<div class="col-lg-3"><img loading="lazy" src="https://hamna.dev/static/media/ui5.c6d3a4a4bc7047d443b1.png" class="gallery-image img-fluid img-thumbnail"></img>
</div>
<div class="col-lg-3"><img loading="lazy" src="" class="gallery-image img-fluid img-thumbnail"></img>
</div>
<div class="col-lg-3"><img loading="lazy" src="https://hamna.dev/static/media/ui7.fa0707f392d1557cc88a.png" class="gallery-image img-fluid img-thumbnail"></img>
</div>
<div class="col-lg-3"><img loading="lazy" src="https://hamna.dev/static/media/ui8.59789a1da8d6e7ebf681.png" class="gallery-image img-fluid img-thumbnail"></img>
</div>
</div>






    </div>
    
  );
};
